import React from 'react';
import {MotiView, MotiImage} from 'moti';

const AnimatedView = () => {
    return (
    <View>
        <MotiView
        from={{
            scale: 0.1,
        }}
        animate={{scale: 1}}
        style={{
            width: 100,
            height: 100,
            borderRadius: 10,
            backgroundColor: 'red',
        }}>
        </MotiView>
    </View>
    )
};

export default animatedView;
